            </div>
            <style jsx>{`
                .itemContainer{
                    border-bottom: #C4C4C4 1px solid;
                    margin-bottom: 10px;

                    display: flex;
                }

            `}</style>
        </React.Fragment >
    )
}

export default WorkoutItem
